import React from 'react';

import './styles/global.css';
import './styles/pages/landing.css';

import logoImg from './src'

// JSX - JavaScript XML
// Compomente: Funcao JS que retorna HTML
// Passar atributo para um componente -> propriedade

function App() {
  return (
    <div id="page-landing">
      <div className="content-wrapper">
        <img src={logoImg} alt="HappyLogo"/>
      </div>
    </div>
  );
}

export default App;
